import React from 'react';
const rdfetch = require('@rdfjs/fetch');
const Test = props => (
    <p>Proov</p>
);

Test.getInitialProps = async function (context) {
    const a = ["sinisilm"];
  async function main () {
        try {
            const res = await rdfetch('http://www.muis.ee/rdf/objects-by-museum/145873', {
                headers: {
                    accept: 'application/rdf+xml'
                }
            })

            const dataset = await res.dataset();

            for (const quad of dataset) {
                if(quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P46_is_composed_of")
                //console.log("subjekt: " + quad.subject.value + ' predikaat: ' + quad.predicate.value + ' objekt: ' + quad.object.value)
                    console.log(' objekt: ' + quad.object.value);
            }
        } catch (err) {
            console.error(err)
        }
    }



    main();

    return {a};
};
export default Test
